            align-items: center;
        }

        .buttons {
            display: flex;
            flex-direction: column;
            margin-bottom: 20px;
            gap: 20px;

            @media (max-width: 768px) {
                width: 100%;
                align-items: center;
            }

            .btn {
                border: none;
                padding: 20px 30px;
                cursor: pointer;
                font-size: 2em;
                white-space: nowrap;
                border-radius: 10px;
                transition: background-color 0.3s ease, color 0.3s ease;
                transform: translateY(50px);
                animation: slideUp 0.5s ease forwards;

              &.circular-design {
                background-color: black;
                color: white;
                animation-delay: 0.3s;
              }

              &.inclusive-business {
                background-color: transparent;
                color: black;
                animation-delay: 0.5s;

                &:hover {
                    background-color: black;
                    color: white;
                }
              }

              &.inverse-piracy {
                background-color: transparent;
                color: black;
                animation-delay: 0.7s;

                &:hover {
                    background-color: black;
                    color: white;
                }
              }
              @media (max-width: 768px) {
                width: 90%;
                font-size: 1.5em;
                padding: 15px 20px;
              }
            }
        }

        .diagram {
            width: 50%;
            text-align: center;
            opacity: 0;
            transform: translateY(50px);
            animation: slideUp 0.5s ease forwards 1s;

            img {
                max-width: 100%;
                height: auto;
                margin-bottom: 10px;
            }

            p {
                font-size: 1.1rem;
                line-height: 1.3;
                width: 100%;
            }

            @media(max-width: 768px) {
                width: 90%;
                padding-bottom: 20px;
            }
        }
    }
}


